import React from "react";

export default function Header() {
    return(
        <header>
            <nav>
                <div className="navbar-stripes"></div>
                <div className="navbar-stripes"></div>
                <div className="navbar-stripes"></div>
                <h2 className="navbar-logo">Capital-Core</h2>
                <h2 className="navbar-signin">Sign In</h2>
            </nav>
        </header>
    )
}
